_DESCRIPTION="French VoxForge corpus to train speech2text engine"


class VoxForgeConfig(datasets.BuilderConfig):
    """BuilderConfig for VoxForgeConfig."""
    def __init__(self, name, description, **kwargs):
        super(VoxForgeConfig, self).__init__(
            name=name, version=datasets.Version("1.0.0", ""), description=description, **kwargs
        )

class VoxForge(datasets.GeneratorBasedBuilder):

    BUILDER_CONFIGS = [
        VoxForgeConfig(name="VoxForge", description=_DESCRIPTION),
    ]

    def _info(self):
        features = datasets.Features(
            {
                "client_id": datasets.Value("string"),
                "path": datasets.Value("string"),
                "sentence": datasets.Value("string"),
            }
        )

        return datasets.DatasetInfo(
            description=_DESCRIPTION,
            features=features,
            supervised_keys=None,
        )
    
    def _split_generators(self, dl_manager):
        """Returns SplitGenerators."""
        data_dir = dl_manager.download_and_extract(_LIST_URLS)
        return [
            datasets.SplitGenerator(
                name=datasets.Split.TEST,
                # These kwargs will be passed to _generate_examples
                gen_kwargs={
                    "folderspath": data_dir,
                },
            )
        ]

    def _generate_examples(self, folderspath):
        """ Yields examples. """
        data_fields = list(self._info().features.keys())
        id_ = -1
        for folderpath in folderspath:
            path = glob.glob(folderpath+"/*/etc/prompts-original")[0].split('/')
            
            folderpath = '/'.join(path[:-3])
            textpath = '/'.join(path)
            client_id = path[-3]
            
            with open(textpath, encoding="utf-8") as f:
                lines = f.readlines()

                for line in lines:
                    line = line.strip().split(" ")
                    
                    audio_path = os.path.join(folderpath, client_id, "wav", line[0]+".wav")
                    text = ' '.join(line[1:])
                    field_values = [client_id, audio_path, text]
                    
                    if os.path.exists(audio_path):
                        id_ += 1
                        yield id_, {key: value for key, value in zip(data_fields, field_values)}
                    

